from typing import Optional
from collections import OrderedDict

def first_unique_char(s: str) -> Optional[str]:
    count = OrderedDict()
    for c in s:
        if c in count:
            count[c] += 1
        else:
            count[c] = 1
    for c in count:
        if count[c] == 1:
            return c
    return None
